import React from "react";
import Dropdown from 'react-bootstrap/Dropdown'

export default function Owner() {
  return (
    <div>
      <h1>Welcome shop owner!</h1>
      <h2>Below is a menu of available toppings. Please select which toppings you would like to use.</h2>
      <DropdownButton id="dropdown-basic-button" title="Dropdown button">
      <Dropdown.Item href="#/action-1">Peppooni</Dropdown.Item>
      <Dropdown.Item href="#/action-2">Sausage</Dropdown.Item>
      <Dropdown.Item href="#/action-3">Mushrooms</Dropdown.Item>
    </DropdownButton>
    </div>
  )
}
